import React from 'react';
import Card from './Card';

function Projects() {
    return (
        <Wrapper>
            <Title>Projects</Title>
            {this.state.Projects.map(project => (
                <Projects
                    id={project.id}
                    key={project.id}
                    name={project.name}
                    image={project.image}
                    description={project.description}
                />
            ))}
        </Wrapper>
    );
}

export default Projects;
